from numpy import einsum
from numpy.typing import NDArray
from chem.hf.intermediates_builders import Intermediates
from chem.ccsd.uhf_ccsd import UHF_CCSD_Data
from chem.meta.spin_mbe import Spin_MBE, E1_spin, E2_spin


def get_cc_j_w_doubles_aaaa(
    uhf_scf_data: Intermediates,
    uhf_ccsd_data: UHF_CCSD_Data,
    vector: Spin_MBE,
) -> NDArray:
    """ tensor_subscripts: ('a', 'b', 'j', 'i') """
    r1_aa = vector.singles[E1_spin.aa]
    r1_bb = vector.singles[E1_spin.bb]
    r2_aaaa = vector.doubles[E2_spin.aaaa]
    r2_abab = vector.doubles[E2_spin.abab]
    r2_abba = vector.doubles[E2_spin.abba]
    r2_baab = vector.doubles[E2_spin.baab]
    r2_baba = vector.doubles[E2_spin.baba]
    r2_bbbb = vector.doubles[E2_spin.bbbb]
    f_aa = uhf_scf_data.f_aa
    f_bb = uhf_scf_data.f_bb
    g_aaaa = uhf_scf_data.g_aaaa
    g_abab = uhf_scf_data.g_abab
    g_bbbb = uhf_scf_data.g_bbbb
    kd_aa =  uhf_scf_data.identity_aa
    kd_bb =  uhf_scf_data.identity_bb
    va = uhf_scf_data.va
    vb = uhf_scf_data.vb
    oa = uhf_scf_data.oa
    ob = uhf_scf_data.ob
    t1_aa = uhf_ccsd_data.t1_aa
    t1_bb = uhf_ccsd_data.t1_bb
    t2_aaaa = uhf_ccsd_data.t2_aaaa
    t2_abab = uhf_ccsd_data.t2_abab
    t2_bbbb = uhf_ccsd_data.t2_bbbb
    
    contracted_intermediate =  1.00 * einsum('kj,bi,ak->abji', f_aa[oa, oa], t1_aa, r1_aa, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa =  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('ac,bi,cj->abji', f_aa[va, va], t1_aa, r1_aa, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    cc_j_w_doubles_aaaa +=  1.00 * einsum('kc,abij,ck->abji', f_aa[oa, va], t2_aaaa, r1_aa, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00 * einsum('kc,abij,ck->abji', f_bb[ob, vb], t2_aaaa, r1_bb, optimize=['einsum_path', (0, 2), (0, 1)])
    contracted_intermediate = -1.00 * einsum('kc,abik,cj->abji', f_aa[oa, va], t2_aaaa, r1_aa, optimize=['einsum_path', (0, 1), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('kc,cbij,ak->abji', f_aa[oa, va], t2_aaaa, r1_aa, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->baji', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('kc,aj,bi,ck->abji', f_aa[oa, va], t1_aa, t1_aa, r1_aa, optimize=['einsum_path', (0, 3), (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('kc,aj,bi,ck->abji', f_bb[ob, vb], t1_aa, t1_aa, r1_bb, optimize=['einsum_path', (0, 3), (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('kc,ak,bi,cj->abji', f_aa[oa, va], t1_aa, t1_aa, r1_aa, optimize=['einsum_path', (0, 1), (1, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('kc,bi,cj,ak->abji', f_aa[oa, va], t1_aa, t1_aa, r1_aa, optimize=['einsum_path', (0, 3), (1, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('kj,abik->abji', f_aa[oa, oa], r2_aaaa)
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('ac,cbij->abji', f_aa[va, va], r2_aaaa)
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->baji', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('kc,bi,cajk->abji', f_aa[oa, va], t1_aa, r2_aaaa, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('kc,bi,acjk->abji', f_bb[ob, vb], t1_aa, r2_abab, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('kc,bk,caij->abji', f_aa[oa, va], t1_aa, r2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->baji', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('kc,ci,abjk->abji', f_aa[oa, va], t1_aa, r2_aaaa, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('kaij,bk->abji', g_aaaa[oa, va, oa, oa], r1_aa)
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->baji', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('abcj,ci->abji', g_aaaa[va, va, va, oa], r1_aa)
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('lkij,bl,ak->abji', g_aaaa[oa, oa, oa, oa], t1_aa, r1_aa, optimize=['einsum_path', (0, 1), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->baji', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('kacj,bi,ck->abji', g_aaaa[oa, va, va, oa], t1_aa, r1_aa, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('akjc,bi,ck->abji', g_abab[va, ob, oa, vb], t1_aa, r1_bb, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('kacj,bk,ci->abji', g_aaaa[oa, va, va, oa], t1_aa, r1_aa, optimize=['einsum_path', (0, 1), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('kacj,ci,bk->abji', g_aaaa[oa, va, va, oa], t1_aa, r1_aa, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('abcd,di,cj->abji', g_aaaa[va, va, va, va], t1_aa, r1_aa, optimize=['einsum_path', (0, 1), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('lkcj,abil,ck->abji', g_aaaa[oa, oa, va, oa], t2_aaaa, r1_aa, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('lkjc,abil,ck->abji', g_abab[oa, ob, oa, vb], t2_aaaa, r1_bb, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate) 
    contracted_intermediate =  0.50 * einsum('lkcj,ablk,ci->abji', g_aaaa[oa, oa, va, oa], t2_aaaa, r1_aa, optimize=['einsum_path', (0, 1), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('lkcj,cbil,ak->abji', g_aaaa[oa, oa, va, oa], t2_aaaa, r1_aa, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('kljc,bcil,ak->abji', g_abab[oa, ob, oa, vb], t2_abab, r1_aa, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('kacd,dbij,ck->abji', g_aaaa[oa, va, va, va], t2_aaaa, r1_aa, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->baji', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('akdc,dbij,ck->abji', g_abab[va, ob, va, vb], t2_aaaa, r1_bb, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->baji', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('kacd,dbik,cj->abji', g_aaaa[oa, va, va, va], t2_aaaa, r1_aa, optimize=['einsum_path', (0, 1), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('akcd,bdik,cj->abji', g_abab[va, ob, va, vb], t2_abab, r1_aa, optimize=['einsum_path', (0, 1), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
    contracted_intermediate =  0.50 * einsum('kacd,cdij,bk->abji', g_aaaa[oa, va, va, va], t2_aaaa, r1_aa, optimize=['einsum_path', (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->baji', contracted_intermediate) 
    cc_j_w_doubles_aaaa += -1.00 * einsum('lkcd,abij,dl,ck->abji', g_aaaa[oa, oa, va, va], t2_aaaa, t1_aa, r1_aa, optimize=['einsum_path', (0, 2), (1, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00 * einsum('lkdc,abij,dl,ck->abji', g_abab[oa, ob, va, vb], t2_aaaa, t1_aa, r1_bb, optimize=['einsum_path', (0, 2), (1, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00 * einsum('klcd,abij,dl,ck->abji', g_abab[oa, ob, va, vb], t2_aaaa, t1_bb, r1_aa, optimize=['einsum_path', (0, 2), (1, 2), (0, 1)])
    cc_j_w_doubles_aaaa += -1.00 * einsum('lkcd,abij,dl,ck->abji', g_bbbb[ob, ob, vb, vb], t2_aaaa, t1_bb, r1_bb, optimize=['einsum_path', (0, 2), (1, 2), (0, 1)])
    contracted_intermediate =  1.00 * einsum('lkcd,abil,dj,ck->abji', g_aaaa[oa, oa, va, va], t2_aaaa, t1_aa, r1_aa, optimize=['einsum_path', (0, 3), (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('lkdc,abil,dj,ck->abji', g_abab[oa, ob, va, vb], t2_aaaa, t1_aa, r1_bb, optimize=['einsum_path', (0, 3), (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('lkcd,al,dbij,ck->abji', g_aaaa[oa, oa, va, va], t1_aa, t2_aaaa, r1_aa, optimize=['einsum_path', (0, 3), (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->baji', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('lkdc,al,dbij,ck->abji', g_abab[oa, ob, va, vb], t1_aa, t2_aaaa, r1_bb, optimize=['einsum_path', (0, 3), (0, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->baji', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('lkcd,aj,dbil,ck->abji', g_aaaa[oa, oa, va, va], t1_aa, t2_aaaa, r1_aa, optimize=['einsum_path', (0, 3), (1, 2), (0, 1)])
    cc_j_w_doubles_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abji->abij', contracted_intermediate)  + -1.00000 * einsum('abji->baji', contracted_intermediate)  +  1.00000 * einsum('abji->baij', contracted_intermediate) 
